import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import "./index.css";


import { CartProvider } from "./context/CartContext";
import { WishlistProvider } from "./context/WishlistContext"; // make sure file name matches (if it's WishlistContext.jsx)


ReactDOM.createRoot(document.getElementById("root")).render(
  <React.StrictMode>
    <CartProvider>
      <WishlistProvider>
        <App />
      </WishlistProvider>
    </CartProvider>
  </React.StrictMode>
);
